import React from 'react'
import Slider from "react-slick";

function TrendingCard(props){


    console.log(props.data)

    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3
      };
    


    

    return(
        
 props.data.map((e)=>{
     
        return <div key={e.id}>
            <h1>{e.attributes.canonicalTitle}</h1>
            <img alt={e.attributes.canonicalTitle} src={e.attributes.posterImage.small}></img>
            <Slider></Slider>
        </div>
    })
        
       )
}

export default TrendingCard
